const history={images:document.querySelectorAll(".history-container img"),back:t=>{const e=t.target.dataset.number,i=window.location.href.split("/"),o=i[i.length-1].split("-").filter((t,i)=>{if(i<=e)return!0});window.location.href=`/search/${o.join("-")}`}};history.images.forEach(t=>{t.addEventListener("click",history.back)});